Date.prototype.getWeekNumber=function(){var a=new Date(+this);a.setHours(0,0,0);a.setDate(a.getDate()+4-(a.getDay()||7));return Math.ceil((((a-new Date(a.getFullYear(),0,1))/86400000)+1)/7)};Date.prototype.getDateString=function(){var f=new Date(+this);var c=f.getFullYear();var e=f.getMonth()+1;var b=f.getDate();var a=""+c+"-"+("0"+e).slice(-2)+"-"+("0"+(b)).slice(-2);return a};Date.prototype.getDateTimeString=function(){var i=new Date(+this);var f=i.getFullYear();var g=i.getMonth()+1;var c=i.getDate();var a=i.getHours();var h=i.getMinutes();var e=i.getSeconds();var b=""+f+"-"+("0"+g).slice(-2)+"-"+("0"+(c)).slice(-2);b+=" "+("0"+a).slice(-2)+":"+("0"+(h)).slice(-2)+":"+("0"+(e)).slice(-2);return b};Date.prototype.parseDate=function(f){var i=new Date(+this);if(f.length==10){var e=f.substr(0,4);i.setFullYear(e);var g=f.substr(5,2);i.setMonth(--g);var b=f.substr(8,2);i.setDate(b);i.setHours(0,0,0,0);return i}else{if(f.length==16){var e=f.substr(0,4);i.setFullYear(e);var g=f.substr(5,2);i.setMonth(--g);var b=f.substr(8,2);i.setDate(b);var a=f.substr(11,2);var c=f.substr(14,2);i.setHours(a,c,0,0);return i}else{if(f.length==19){var e=f.substr(0,4);i.setFullYear(e);var g=f.substr(5,2);i.setMonth(--g);var b=f.substr(8,2);i.setDate(b);var a=f.substr(11,2);var c=f.substr(14,2);var h=f.substr(17,2);i.setHours(a,c,h,0);return i}else{return null}}}};